import React from "react";
import "./about.css";
import Picture from "./profilepicture.jpg";





function About() {
  return (
    <div className="about-card">
    <div className="about-content">

      <div class="row">  
        <div class="col-lg-12">
            <img src={Picture} alt="Profile Picture"  />
            <h4> 
              Hello! My name is Suzie Stephen and I am a coding student at The Coding Bootcamp. 
              <br></br>I work full time as a Product Manager for a company that speciliases in Agritech. 
              <br></br>I am taking this coding course to make me a better Product Manager. 
              <br></br>I am interested in learning more about UX and UI design after taking this course. 
            </h4>
        </div>
      </div>
    </div>
  </div>






  );
}

export default About;
